func (c *current) onField1(name, val any) (any, error) {
	return SlotDecl{
		Named:      name.(String).Value,
		Value:      val.(Node),
		Visibility: PublicVisibility,
		Loc: &SourceLocation{
			Line:   c.pos.line,
			Column: c.pos.col,
			Length: len(string(c.text)),
		},
	}, nil
}

func (p *parser) callonField1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onField1(stack["name"], stack["val"])
}

func (c *current) onCall1(name, args any) (any, error) {
	// Symbol followed by () - create Select with nil Receiver
	argRecord := Record(args.([]Keyed[Node]))
	return Select{
		Receiver: nil,
		Field:    name.(string),
		Args:     &argRecord,
		Loc: &SourceLocation{
			Line:   c.pos.line,
			Column: c.pos.col,
			Length: len(string(c.text)),
		},
	}, nil
}

func (p *parser) callonCall1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onCall1(stack["name"], stack["args"])
}

func (c *current) onSymbol1(name any) (any, error) {
	// Just a Symbol
	return Symbol{
		Name:     name.(string),
		AutoCall: true,
		Loc: &SourceLocation{
			Line:   c.pos.line,
			Column: c.pos.col,
			Length: len(string(c.text)),
		},
	}, nil
}

func (p *parser) callonSymbol1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onSymbol1(stack["name"])
}

func (c *current) onSelectOrCall1(left, name, args any) (any, error) {
	if args != nil {
		// Select followed by () - add Args field
		argRecord := Record(args.([]Keyed[Node]))
		return Select{
			Receiver: left.(Node),
			Field:    name.(string),
			Args:     &argRecord,
			Loc: &SourceLocation{
				Line:   c.pos.line,
				Column: c.pos.col,
				Length: len(string(c.text)),
			},
		}, nil
	} else {
		// Just a Select
		return Select{
			Receiver: left.(Node),
			Field:    name.(string),
			Args:     nil,
			AutoCall: true,
			Loc: &SourceLocation{
				Line:   c.pos.line,
				Column: c.pos.col,
				Length: len(string(c.text)),
			},
		}, nil
	}
}

func (p *parser) callonSelectOrCall1() (any, error) {
	stack := p.vstack[len(p.vstack)-1]
	_ = stack
	return p.cur.onSelectOrCall1(stack["left"], stack["name"], stack["args"])
}

